description:
Couples Seeking Teens 3 (Kevin Moore, Reality Junkies / 2010)

Rebecca and Vannah make up after fighting over Rebecca not doing her work. Vannah's husband comes home and joins the fun.
After being kicked out of her mother's house, Amia moves in with Zoey and Talon. Talon isn't very happy with the situation. He changes her mind.
Ally is tricked and seduced into fucking her friend's mom and dad while she waits for her friend to get home.
Devon and Randy will donate plenty of money towards Brittney's dance troupe, but in return she has to do something for them.
Victoria the babysitter gets an old school spanking when Mellanie and Otto come home early to find her trying on Mellanie's clothes.

Devon Lee, Mellanie Monroe, Ariella Ferrera, Vannah Sterling, Ally Kay, Victoria Lawson, Rebecca Blue, Amia Moretti, Zoe Holloway, Brittney Banks

